import React from 'react';

const CoursesList = () => {
    return (
        <div>
            <table className='table table-bordered table-responsive'>
                <thead>
                    <tr>
                        <th>Title</th>
                        <th>Author ID</th>
                        <th>Category</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>Hello</td>
                        <td>Hello</td>
                        <td>Hello</td>
                    </tr>
                </tbody>
            </table>
        </div>
    );
};

export default CoursesList;
